import './App.css';
import EncounterMember from './EnounterMember.js';

function App() {

  let memberList = [];
  let initiativeOrder = [];

  let testMember = new EncounterMember();
  testMember.initiative = 12;
  testMember.initiative = null;

  return (
    <div className="App">
      <p>
        name: {testMember.name}, init: {testMember.initiative}
      </p>
    </div>
  );
}

export default App;
